# ╔═╡ c586b609-f734-41c9-8584-41bb7be69345
@bind a Slider(1.:0.5:10., show_value = true)

# ╔═╡ 952146ff-a971-471f-9684-b3396333bae6
begin
	xulim=10
	Axis([
		Plots.Linear(x->sin(sqrt(a*x)), (0, xulim), legendentry=L"\sin(\sqrt{ax})", closedCycle=true)
		],
		style="area style, enlarge x limits=false",
	)
end

